INSERT INTO `bandeaux` VALUES (8,' Lors de la mise en place d\'un nouveau catalogue, il ne faut pas changer les dates d\'un précédent catalogue similaire. Il faut dupliquer ce précédent catalogue  puis mettre les bonnes dates dans la copie !! Changer simplement les dates va réactiver toutes les anciennes commandes du catalogue d\'origine....',NULL,'/admin/catalogues','important',1),(11,'Attention, il n\'y aura pas de livraison de pain le mardi 11 novembre. Prévoyez à l\'avance !! ','2025-11-05 00:00:00','/','important',1),(12,'Vous avez maintenant la possibilité de préremplir votre panier avec des articles que vous avez déjà commandés lors des 60 derniers jours','2025-12-11 00:00:00','/panier/*/modifier','important',0),(13,'bfcvc',NULL,'/admin/dashboard/*','info',1);
