de pommes',3,'2026-02-05',1,0,NULL,NULL),(152,'import_sheet','CANARD FRAIS ET CONSERVES','2025-10-18 09:54:23','2025-10-24 00:00:00',170,'ATTENTION:  il n\'y aura probablement pas d\'autre commande de canard frais avant Noel!!!!\r\n\r\nCommande de magrets frais et foie gras d\'Eric Labaste. Producteur de canard déguisé en Mc Gyver de l\'agriculture. Un agri pas comme les autres, engagé dans une agriculture durable et bienveillante envers dame nature.\r\n',3,'2025-11-01',1,0,NULL,NULL),(153,'d5fe768cdd52692ed2410b0638a66d9a_copy_copy_copy','LE PAIN D\'ICI ','2025-10-18 11:15:08','2025-10-24 00:00:00',182,'PAIN du mardi 28 octobre',3,'2025-10-28',1,0,NULL,NULL),(154,'d5fe768cdd52692ed2410b0638a66d9a_copy_copy_copy_copy_copy','LE PAIN D\'ICI ','2025-10-18 11:16:37','2025-10-24 00:00:00',182,'PAIN du jeudi 30 OCTOBRE',3,'2025-10-30',1,0,NULL,NULL),(160,'import_sheet_copy','Truite de la maison Truchetet ','2025-10-22 12:03:02','2025-10-31 00:00:00',160,' Truite commande  ',3,'2025-11-04',1,0,NULL,NULL),(161,'import_sheet','Fromage de Brebis GAEC Gaztelu (date livraison à affiner) ','2025-10-22 22:07:03','2025-11-04 00:00:00',170,' Kattyn et Cédric ont repris la ferme familiale des parents de Cédric. Ils vous proposent du fromage de brebis en direct de Barcus.',3,'2025-11-08',1,0,NULL,NULL),(164,'A changer','POISSONS DE CAPBRETON (Le GAVROCHE) - Commande de Novembre 2025','2025-10-23 16:45:25','2025-11-20 00:00:00',198,'Avec le fileyeur « Le Gavroche » de Capbreton, voici au catalogues son offre habituelle de pochettes \"surprise\", dont le contenu dépend de la pêche du jour. Les pochettes, pèsent 2 ou 3 kg, sont proposées au tarif de 10 € le kilo, auxquels s’ajoutent 2 € de frais de port, soit un total de 22 € ou 32 € selon le poids. L’assortiment varie en fonction des poissons disponibles selon la saison et les prises.\r\nPrécisons que la commande ne pourra être passée que si au moins 8 pochettes sont réservées, afin d’assurer la rentabilité pour Gavroche. \r\nLes livraisons, difficiles à planifier longtemps à l’avance en raison de la météo ou des aléas de la pêche, auront lieu uniquement pendant les jours d’ouverture de l’épicerie : le mardi, le jeudi après-midi ou le samedi matin. Cela permet de garantir la fraîcheur du poisson. Vous serez informés régulièrement via le groupe signal « Coop’Az général », veillez donc à être disponibles pour venir récupérer (ou faire récupérer) votre commande à la date indiquée.\r\n',3,'2025-11-22',1,0,NULL,NULL),(165,'A changer_copy','Volailles Christian BRUN à  Magescq   ','2025-10-24 12:17:58','2025-10-26 00:00:00',153,'livraison 30 Oct. Maison familiale dont les volailles sont élevées en forêt.\r\nPour avoir un gros poulet merci de le mettre en NOTE',3,'2025-10-30',1,0,NULL,NULL),(167,'d5fe768cdd52692ed2410b0638a66d9a_copy_copy_copy','LE PAIN D\'ICI ','2025-10-25 16:50:50','2025-10-31 00:00:00',182,' PAIN du mardi 4 NOVEMBRE',3,'2025-11-04',1,0,NULL,NULL),(168,'d5fe768cdd52692ed2410b0638a66d9a_copy_copy_copy_copy_copy','LE PAIN D\'ICI','2025-10-25 16:52:17','2025-10-31 00:00:00',182,'PAIN du jeudi 6 NOVEMBRE',3,'2025-11-06',1,0,NULL,NULL),(173,'A changer_copy','Bœuf  PIERRE   ','2025-10-25 19:00:44','2025-11-14 00:00:00',153,'Ferme LESCLAOUZON  à LABATUT race limousine ',3,'2025-11-22',1,0,NULL,NULL),(179,'A changer_copy','Volailles Christian BRUN à  Magescq    ','2025-10-28 08:10:45','2025-11-01 00:00:00',153,'LIVRAISON 6 NOV. Maison familiale dont les volailles sont élevées en forêt.\r\nPour avoir un gros poulet merci de le mettre en NOTE',3,'2025-11-06',1,0,NULL,NULL),(180,'import_sheet','porc BIO Raphael  ','2025-10-28 08:22:29','2025-11-07 00:00:00',153,' Ferme d\'Arracq  à Marpaps 40  \r\n',3,'2025-11-15',1,0,NULL,NULL),(182,'import_sheet_copy','Truite de la maison Truchetet  ','2025-10-29 16:50:29','2025-11-14 00:00:00',153,' Truite commande  ',3,'2025-11-18',1,0,NULL,NULL),(184,'d5fe768cdd52692ed2410b0638a66d9a_copy_copy_copy_copy_copy','LE PAIN D\'ICI ','2025-10-31 10:40:12','2025-12-