INSERT INTO `help_texts` VALUES (6,'home','Catalogues : donne accès à la liste des catalogues\r\nPaniers : donne accès à vos paniers qui n\'ont pas encore été transformés en commande\r\nCommandes : les commandes qui seront prises en compte par les responsables Produits'),(7,'panier','Vous avez sur cette page, tous vos paniers en cours. Vous pouvez ajouter des notes par article pour apporter une précision à la commande.\r\nImportant : un panier qui n\'est pas validé ne déclenchera pas de commande !!!!'),(9,'commandes','Vous avez ici toutes vos commandes en cours de validité (si le catalogue encore visible). Si vous voulez changer quelques choses dans une de vos commandes, il faut la repasser en panier, puis aller dans \"Vos paniers\" pour faire vos changements. N\'oubliez pas de valider ce panier pour le retrouver dans vos commandes !\r\nPour supprimer une commande, repassez la en panier, puis \"Supprimer ce panier\"'),(10,'catalogues','choisissez un catalogue à partir du quel vous pourrez faire votre panier');
